import React, { Component } from "react";
export default class Footer extends Component {
    render() {
        return (
            <Footer>
  <div className="footer">
  <a href="https://github.com/sdsartor">
    <img src="/public/github-mark-white.png" alt="github" id="github"></img></a>
  </div>
</Footer>
        )
    }
}
